detail:
本公司提供UI设计,你只需要根据UI来做前端页面(Html5) ,PS:可能需要做PC/APP 两套

医疗产品的前端开发，包括PC版和APP版。 前后端分离开发，前端框架未定，后端JAVA，通过resultful风格接口交互。
现在后端已经开始开发，由于本公司没有前端工程师，需要找人接手。

1.需求：精通 html, html5，css， javascript，有丰富的前端开发经验。能独立完成网站的前端开发。 工作认真负责，有问题及时沟通; 
2.兼职远程开发，可以不用驻场，每周至少一次远程会;
3.如果后期有添加的页面,或修改的页面,价格另算;
预计07-15号开工

1. 熟练使用HTML5+CSS3+JS编程，熟悉各种前端调试工具； 
2. 熟练使用jQuery,Bootstrap,AngularJs等主流的JS库; 
3. 熟悉前端MVC架构,熟悉页面加载极致和优化方法; 
4.有丰富的微信公众号开发经验;
